rule.ruleString:
function isTStormInDayPart(daypart){

    

    var thunderEnumCodes = [3, 4, 5];

    return daypart.dayPartTitle !== null && thunderEnumCodes.indexOf(daypart.thunderEnum) != -1;

}


function isSevereTStormImpactedNow(){

    if (isTStormInDayPart(context.weatherSummary.dayForecast.day)){

        return true;

    } else if (isTStormInDayPart(context.weatherSummary.dayForecast.night)){

        return true;    

    } else if (context.weatherSummary.dayForecast.day.dayPartTitle == null && isTStormInDayPart(context.weatherSummary.tomorrowForecast.day)){

        return true;

    }

    return false;

}


isSevereTStormImpactedNow();
